import React from "react";
import { useLocation, Link } from "react-router-dom";
import Form from "react-bootstrap/Form";
import { Card } from "react-bootstrap";
import "./style.css";
const ViewUserDetails = (_) => {
  const { state } = useLocation();

  return (
    <div>
      <div className="page-header">
        <h3 className="page-projectName"> Detail List of Applications </h3>
        <nav aria-label="breadcrumb">
          <ol className="breadcrumb">
            <li className="breadcrumb-item">
              <a href="!#" onClick={(event) => event.preventDefault()}></a>
            </li>
          </ol>
        </nav>
      </div>
      <Form>
        <div id="small2">
          <Card border="warning" style={{ width: "40rem" }}>
            <Card.Header  className="card-header d-flex justify-content-between align-items-center">
              <h3>
                Id:<strong>{state.applications.Id}</strong>
              </h3>
              <button type="button" className="btn btn-sm" style={{backgroundColor:'#fec107'}}>Back</button>
            </Card.Header>
            <Card.Body>
              <Card.Title><h5>Application Name: {state.applications.Name}</h5></Card.Title>

            </Card.Body>
          </Card>
        </div>
      </Form>
    </div>
  );
};

export default ViewUserDetails;
